.
Essa foto é de um dos lugares que eu acho mais lindos de Paris - os jardins do Château de Versailles. É tudo muito simétrico, e você nunca verá nada fora do lugar. Os jardins são muito bem cuidados desde a época da sua projeção.
.
Falando nisso, os jardins foram projetados pelo rei sol, Luis XIV, e pelo paisagista André Le Nôtre. Ele trabalhou nesse projeto de 1662 até o ano da sua morte, em 1700. E não foi só isso! Os jardins de Versalhes possuem vários lagos, lugares secretos, bosques, fontes, o Grand Canal com mais de 1km de extensão (no fundo da foto), enfim, um monte de coisas incríveis que vão muito além das árvores.
.
Infelizmente eu nunca tive oportunidade de conhecer os jardins mais a fundo (desvantagens de viajar com excursão, né? 🙄), mas eu tenho certeza de que é muito mais lindo e mais incrível do que o que nós conseguimos conhecer. Ah, e a visitação nos jardins do Château de Versailles é gratuita. Você só paga se quiser entrar no Château. Mas presta atenção: entre os meses de abril e outubro tem dias específicos que as fontes musicais são ligadas, e aí sim você precisa pagar pra acessar os jardins!
.
