Bonjour à tous !
 
One of my most important visions about life is to see the glass half full, notwithstanding the worst situations.

So that because of lockD, I decided in March to start taking French classes 🥐 ❤️

I'm extremely happy despite of the fact I can't talk in French as I can in English, that is my second language, I hope one day I can talk with the same fluency as in English. Btw! My favorite French word is “dècontractè” that means cool, which is a word that I usually express in both languages, it is extremely beautiful!
 
Surely, that trip to Europe last October open my mind in some many ways, and I regret about not started French before. As a communicologist I want to reach the public in a lot of countries, but I am always going to make that extra effort in order to speak their own language! I`m looking forward to be more personal with communication `cause that make you grow emotionally and intelectually, that is, in fact,my job but also my passion.

I'm really proud and happy about this, and I'm already planning my next step.

 Which language do you want to learn?
 
And of course, don't forget: "nunca dejes para mañana lo que puedes hacer hoy"

